interface ISwitchboard {

  // read from aggregator
  function latestResult(address aggregatorAddress) 
    external 
    payable 
    returns (
      int256 value, 
      uint timestamp
    );

  // read round from an aggregator
  function latestRound(address aggregatorAddress) 
